@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("wootoolbox.com") {

/**********************************************************
Global Styles
**********************************************************/
body, #logo, .container
  {
    background: #222 !important;
    color: #999 !important;
  }

.body a
  {
    color: #080 !important;
  }

input[type="text"], input[type="password"], select, option
  {
    background: #bbb !important;
  }

table.v td
  {
    border: solid 1px #444 !important;
    padding: 3px !important;
  }

/**********************************************************
Fix width of textbox on contact form
Not sure if this is a problem with the site in general,
or if it's caused by an extension like ItsAllText.
**********************************************************/
textarea[name="message"]
  {
    width: 100% !important;
  }

/**********************************************************
Replace WooToolbox image
**********************************************************/
img[src*="wootoolbox.png"]
  {
    background-image: url(data:image/png;base64,) !important;
    background-repeat: no-repeat !important;
    padding-left: 250px !important;
    width: 0px !important;
    height: 100px !important;
  }
}
